import React from 'react';
import Header from '../components/Header';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import CoffeeIcon from '@mui/icons-material/Coffee';
import FastfoodIcon from '@mui/icons-material/Fastfood';
import LocalBarIcon from '@mui/icons-material/LocalBar';
import IconButton from '@mui/material/IconButton';
import { useNavigate } from 'react-router-dom'; // if you're using react-router for navigation

function UpdateExpense() {
  const navigate = useNavigate(); // For navigation to the home page

  return (
    <Box m={2} >
        <Header text='How much did I spend today?'/>
        <form>
            <Box my={2}>
                <TextField
                  fullWidth
                  variant="outlined"
                  label="Coffee"
                  InputProps={{
                    startAdornment: <CoffeeIcon />
                  }}
                />
            </Box>
            <Box my={2}>
                <TextField
                  fullWidth
                  variant="outlined"
                  label="Food"
                  InputProps={{
                    startAdornment: <FastfoodIcon />
                  }}
                />
            </Box>
            <Box my={2}>
                <TextField
                  fullWidth
                  variant="outlined"
                  label="Alcohol"
                  InputProps={{
                    startAdornment: <LocalBarIcon />
                  }}
                />
            </Box>
            <Box my={2} display="flex" justifyContent="space-between">
                <Button variant="outlined" onClick={() => navigate(-1)}>Back</Button>
                <Button color="primary" variant="contained">Add expenses</Button>
            </Box>
        </form>
    </Box>
  );
}

export default UpdateExpense;
